import styled from 'styled-components';

const PageWrapperBlock = styled.div`
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
`;

const PageWrapper = ({ children }) => {
  return <PageWrapperBlock>{children}</PageWrapperBlock>;
};

export default PageWrapper;
